import React from 'react';
import { Line } from 'react-chartjs-2';

const PriceHistoryChart = ({ data }) => {
    const chartData = {
        labels: data.map((item) => item.height), // X-axis labels (block height)
        datasets: [
            {
                label: 'Price History',
                data: data.map((item) => item.amount / item.price), // Y-axis data (amount/price)
                fill: false,
                borderColor: 'blue',
            },
        ],
    };

    const options = {
        scales: {
            x: {
                type: 'linear',
                position: 'bottom',
            },
        },
    };

    return (
        <div>
            <h2>Price History Chart</h2>
            <Line data={chartData} options={options} />
        </div>
    );
};

export default PriceHistoryChart;
